const sidebarReducer = (state, action) => {
    switch (action) {
        case "123123123":
            alert("lalka")
            break;
        case 2:
            alert("bitch")
            break;
        default:
            alert("sheat")
            break;
    }
    return state;
}

export default sidebarReducer;
